    <Layout>
      <div className="matter">
        <div className="headers">
          <h1 className="a">Want to be a environmentalist!!</h1>
          <h2 className="head2">
            SignUp for free and be a part of our community
          </h2>
        </div>
        <div className="hp">

        </div>
      </div>
    </Layout>
  );
};

export default HomePage;
